import React from "react";

class Weather extends React.Component {
    render() {
        return (
            <>
                <div>
                    <img src={ this.props.icon }></img>
                    <p></p>{ this.props.city }
                    { this.props.country }
                    { this.props.desc }
                    { this.props.temp }
                    { this.props.humidity }
                </div>
            </>

        )
    }
};

export default Weather;
